-- View structure for viewhelp
-- ----------------------------
DROP VIEW IF EXISTS `viewhelp`;
CREATE ALGORITHM=UNDEFINED DEFINER=`wangyc`@`%` SQL SECURITY DEFINER VIEW `viewhelp` AS select `columns`.`TABLE_NAME` AS `table_name`,`columns`.`COLUMN_NAME` AS `column_name`,`columns`.`COLUMN_COMMENT` AS `column_comment`,`columns`.`DATA_TYPE` AS `data_type`,`columns`.`CHARACTER_MAXIMUM_LENGTH` AS `CHARACTER_maximum_length` from `information_schema`.`COLUMNS` where (`columns`.`TABLE_SCHEMA` = 'eladmin') ;

-- ----------------------------
-- Procedure structure for getDataByDbName
-- ----------------------------
DROP PROCEDURE IF EXISTS `getDataByDbName`;
DELIMITER ;;
CREATE DEFINER=`wangyc`@`%` PROCEDURE `getDataByDbName`(in dbName VARCHAR(255),IN ziduan VARCHAR(255))
BEGIN
DECLARE num INT;
SET @STMT =CONCAT("SELECT COUNT(*) FROM ",dbName," WHERE `",ziduan,"` LIKE BINARY '%82b58c09c93d70cf621fe5a1fddcd100b8a12bc5-20210113052652547%' INTO @num;");
PREPARE STMT FROM @STMT;
EXECUTE STMT;
IF(@num>0) THEN
END IF;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for processquanjusou
-- ----------------------------
DROP PROCEDURE IF EXISTS `processquanjusou`;
DELIMITER ;;
CREATE DEFINER=`wangyc`@`%` PROCEDURE `processquanjusou`()
BEGIN
DECLARE done BOOLEAN DEFAULT 0;
DECLARE biao VARCHAR (255);
DECLARE ziduan VARCHAR (255);
DECLARE indexss CURSOR
FOR
SELECT TABLE_NAME,COLUMN_NAME FROM information_schema.COLUMNS WHERE TABLE_SCHEMA='eladmin' ;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;
OPEN indexss;
repeat
FETCH indexss INTO biao,ziduan;
call  getDataByDbName(biao,ziduan);
UNTIL done END repeat;
CLOSE indexss;
end
;;
DELIMITER ;
