INSERT INTO `about` VALUES ('1', '山东一是一木业有限公司是山东曹县重要的木材加工企业。公路、铁路纵横交错，四通八达，交通十分便利。公司组建于1998年，经过多年的磨练，克服了种种困难，打造出先进的管理流程、造就了一批精干的管理队伍、培养了一批技能精湛员工，引进先进的生产设备，建有细木工板车间、生态板车间。产品选用优良桐木为原料，经过锯切、旋切、压刨、烘干，热压胶和，砂光等多种先进的工艺流程，年生产量达150万张。', '我公司专业生产各种规格细木工板，生态板。我公司生产的“一是一”牌细木工板被多家省内外装饰公司及家具厂等用户列为指定用板，受到客户好评，获得广大客商的信赖和认可。我公司一直恪守“质量为先，信誉至上”的经营宗旨，竭诚为新老客户服务。公司总经理王彦昌热忱欢迎广大客户到我公司考察、参观、指导。', null, 'index.jpg', null, '2021-03-30 22:48:36');
